    msg.payload = {"email": u,"password": p}
    msg.headers["Content-Type"] = "application/json"
    msg.headers["X-Requested-With"] = "XMLHttpRequest"

}
else{
    r = env.get("request");

    if(r=="overview"){
        msg.method = "GET"
        msg.url = "https://api.goslide.io/api/slides/overview" 
